CLANG_VERSION:
- '20.1'
CL_VERSION:
- 19.43.34604
FINAL_CFLAGS:
- -march=nocona -mtune=haswell -ftree-vectorize -fstack-protector-strong -O2 -ffunction-sections
  -pipe
FINAL_CL_FLAGS:
- /Oi /O2 /GS /Gy /MD -march=nocona -mtune=haswell -fuse-ld=lld
FINAL_CXXFLAGS:
- -fvisibility-inlines-hidden -std=c++17 -fmessage-length=0 -march=nocona -mtune=haswell
  -ftree-vectorize -fstack-protector-strong -O2 -ffunction-sections -pipe
RUNTIME_VERSION:
- 14.42.34438
VCVER:
- '14.3'
VSYEAR:
- '2022'
channel_sources:
- conda-forge
channel_targets:
- conda-forge main
target_platform:
- win-64
zip_keys:
- - VCVER
  - VSYEAR
  - RUNTIME_VERSION
  - CL_VERSION
